import Login from "./views/login";
// import Profile from "./views/profiles";
import SeePost from "./views/seePost";
export default function App(){
return(
    <Router>
          <div style={{height: "100%"}}>
          {routes.map((route,index)=>{
            return(
              <Route
              key={index}
              path={route.path}
              exact={route.exact}
              component={Login} />
          )})}
          </div>
      </Router>
    )
};
